import { Component, useState } from "react";
import styles from './Form.module.css';

// Bootstrap Components
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Form from 'react-bootstrap/Form';
import Button from 'react-bootstrap/Button';
import InputGroup from 'react-bootstrap/InputGroup';
import DropdownButton from 'react-bootstrap/DropdownButton';
import Dropdown from 'react-bootstrap/Dropdown';
import FormControl from 'react-bootstrap/FormControl';

const CustomForm = (props) => {
    const [newCustState, setCustState] = useState(false);

    function handleChange1(event) {
        props.onChange(event.target.value);
    }

    function handleChange2(event) {
        props.onChange(event.target.value);
    }

    const handleNewUser = (event) => {
        setCustState(true);
    };

    const saveNewUser = (event) => {
        setCustState(false);
    };

    return (
        <div>
            <Form className={styles.drawer-panel}>
                <Form.Group>
                    <Form.Label>Project Name</Form.Label>
                    <Form.Control 
                        name={props.value} 
                        onChange={handleChange1}
                        placeholder="What's the project name?" 
                    />
                </Form.Group>

                <InputGroup>
                    <FormControl
                        owner={props.value} 
                        onChange={handleChange2}
                        placeholder="What's your name?"
                    />
                    {/* <Dropdown.Item onClick={handleNewUser}>{values.projectOwner}</Dropdown.Item> */}
                </InputGroup>
{/* 
                {newCustState ? 
                <Form.Group>
                    <Form.Label>New Customer</Form.Label>
                    <Form.Control 
                        value={values.projectOwner} 
                    />
                    <Button onClick={saveNewUser}>Save</Button>
                </Form.Group>
                : null} */}
            </Form>
        </div>
    );
};
export default CustomForm;
